snippet.description:
👉Prenota qui GRATIS il posto a Game Ground Bolzano: https://bit.ly/42AJUmC
Vuoi supportarci con un abbonamento? QUI: https://www.youtube.com/channel/UCxKrf2zGbarAs-3zu_OQ-tw/join

Una domenica che è domenica che altrimenti non sarebbe domenica ma sarebbe lunedì, martedì, mercoledì, giovedì, venerdì, sabato e perlappunto non domenica. Perlappunto. Scritto così, che è sbagliato e devo lottare anche contro il correttore. Buona domenica vah!

INDICE DELLE #NEWS VIDEOGIOCHI:
0:00 - Intro con prenotazione;
0:58 - Xbox Game Pass Ultimate non aumenterà per tutti. Ecco chi sarà esentato;
1:48 - Xbox: la prossima console potentissima (Magnus) si farà;
2:29 - Co-fondatrice di Xbox, Laura Fryer, su Xbox: "avidità e insensibilità";
3:18 - Amazon: in vendita un bundle Xbox… senza Xbox;
3:36 - Microsoft chiarisce che i videogiochi digitali acquistati NON sono davvero nostri;
4:24 - Ubisoft avrebbe cancellato un Assassin's Creed con protagonista uno schiavo africano;
4:55 - Negli USA il 60% dei videogiocatori acquista meno di due giochi all'anno;
5:39 - I videogiochi fanno bene. Anche agli italiani. Lo dice uno studio;
6:49 - Clair Obscure Expedition 33 a quota 5 milioni e in arrivo nuovi contenuti;
7:00 - PS6: le caratteristiche di cui ora anche Sony e AMD parlano in maniera "ufficiosa";
8:34 - PS6 in uscita nel 2027?
8:56 - Fallout Day: dobbiamo aspettarci l'annuncio di Fallout 3 Remastered? Forse no;
9:26 - Vediamo i 3 videogiochi più venduti in Italia in questo periodo;
9:44 - Roblox nel mirino: un pericolo per i bambini, secondo il Kentucky;
10:28 - MindsEye: ci sono dei risvolti spiacevoli per gli sviluppatori, che denunciano i capi;
11:17 - FBC Firebreak è un flop e ha fatto perdere tanti soldi a Remedy;
11:44 - Un film Minecraft 2 in arrivo nel 2027;
11:58 - Il corto animato di Nintendo "Close to You" ha a che fare con Pikmin, ma non è un nuovo gioco;
12:22 - Nintendo Switch Online: tre "nuovi" giochi aggiunti al catalogo SNES;
12:33 - NEWS A RAFFICA;
14:52 - Saluti con suspance fatta apposta. E non dovevo scriverlo qui, per alimentare il mistero…

#ADV

